import React from 'react';
import "./css/root.css";

export default function ItemDisplayer({ title, img, onClick }) {
    return (
        <div className='item' onClick={onClick} style={{ cursor: "pointer" }}>
            <h3>{title}</h3>
            <img src={img} alt={title} />
        </div>
    );
}
